    #region Variables
    [Parameter]
    public string ProviderId { get; set; }

    ProviderDTO oProvider = new ProviderDTO();
    RouteDTO Route = new RouteDTO();
    public string Message;



    #endregion

    #region| Metodos

    protected override async Task OnInitializedAsync()
    {
        try
        {
            var tryGetProvider = _router.Get(Int32.Parse(ProviderId));
            if (!tryGetProvider.IsSuccess)
            {
                Message = tryGetProvider.Message;
            }
            else
            {
                oProvider = tryGetProvider.Data;
                Route = oProvider.Route;
            }
        }
        catch (Exception e)
        {

            Message = e.Message;
        }

    }

    private void Save()
    {
        try
        {
            oProvider.Route = Route;
            var actionResponse = _router.Update(oProvider);

            if (actionResponse.IsSuccess)
            {
                NavManager.NavigateTo("Providers/Index");
            }
            else
            {
                Message = actionResponse.Message;
            }
        }
        catch (Exception e)
        {

            Message = e.Message;
        }

    }

    private void HandleValidSubmit()
    {
        Console.WriteLine("OnValidSubmit");
    }

